<template>
  <div class="col" id="a">
    <button
      type="button"
      data-bs-toggle="offcanvas"
      data-bs-target="#offcanvasRight"
      aria-controls="offcanvasRight"
      @click="updateAlarm"
    >
      <font-awesome-icon
        :icon="['far', 'bell']"
        style="color: #bdbdbd"
        type="button"
      />
    </button>
    <div
      class="offcanvas offcanvas-end"
      tabindex="-1"
      id="offcanvasRight"
      aria-labelledby="offcanvasRightLabel"
    >
      <div class="offcanvas-header">
        <button
          type="button"
          class="btn-close"
          data-bs-dismiss="offcanvas"
          aria-label="Close"
        >
          <svg
            width="22"
            height="24"
            viewBox="0 0 22 24"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
            xmlns:xlink="http://www.w3.org/1999/xlink"
          >
            <rect width="22" height="24" fill="url(#pattern0)" />
            <defs>
              <pattern
                id="pattern0"
                patternContentUnits="objectBoundingBox"
                width="1"
                height="1"
              >
                <use
                  xlink:href="#image0_66_646"
                  transform="matrix(0.00113122 0 0 0.00103695 0 -0.00810709)"
                />
              </pattern>
              <image
                id="image0_66_646"
                width="884"
                height="980"
                xlink:href="data:image/png;base64,"
              />
            </defs>
          </svg>
        </button>
        <h5 class="offcanvas-title" id="offcanvasRightLabel">알림</h5>
        <div></div>
      </div>
      <div class="offcanvas-body alert-body">
        <alarm-detail
          v-for="(alarm, index) in this.alarms"
          :key="index"
          :alarm="alarm"
          @detail-click="handleDetailClick"
        ></alarm-detail>
      </div>
    </div>
  </div>
</template>
<script>
import axios from "axios";
import AlarmDetail from "./AlarmDetail.vue";
export default {
  setup() {},
  data() {
    return {
      alarms: [],
    };
  },
  components: {
    AlarmDetail,
  },
  methods: {
    updateAlarm() {
      let token = sessionStorage.getItem("token");
      axios({
        url: `${process.env.VUE_APP_API_URL}/api/v1/alarm`,
        headers:
          token === null
            ? null
            : {
                Authorization: `Bearer ${token}`,
              },
        method: "GET",
      })
        .then((data) => {
          this.alarms = data.data;
          console.log(this.alarms);
        })
        .catch(() => {
          this.alarms = [];
        });
    },
    closeOffcanvas() {
      // 오프캔버스 닫기
      const closeBtn = document.querySelector(".btn-close");
      closeBtn.click();
      // if (this.offcanvasInstance) {
      // this.offcanvasInstance.hide();
      // }
    },
    handleDetailClick() {
      // Detail 컴포넌트 클릭 시 동작
      this.closeOffcanvas();
    },
  },
};
</script>
